$(document).ready(function(){var t=["expected","actual"];$(".highlight").hover(function(e){for(var n=$(e.currentTarget).attr("id").split("_"),h=n[0],r=1;r<n.length-2;r++)h+="_"+n[r];t.forEach(function(t){$("#"+h+"_"+t+"_"+n[n.length-1]).children().each(function(){$(this).addClass("highlight-hover")})})},function(e){var n=$(e.currentTarget).attr("id").split("_"),h=n.length-1;h=n[0];for(var r=1;r<n.length-2;r++)h+="_"+n[r];t.forEach(function(t){$("#"+h+"_"+t+"_"+n[n.length-1]).children().each(function(){$(this).removeClass("highlight-hover")})})});var e=document.getElementsByClassName("line_number"),n=8*Math.floor(Math.log10(e.length)+1)+2;$(".line_number").css("width",n+"px")});